import './Modal.css'

const Modal=({active,setActive})=>{
  return(
    <div className='modal' onClick={()=>setActive(false)}>
      <div className='modal__content' onClick={(e)=>e.stopPropaga()}>

      </div>
    </div>
  )
}
export default Modal;
